import React from 'react';
import { Box } from '@material-ui/core';
import AvatarCard from './avatarCard';
import CardComp from './card';
import MySignUpsIcon from '';


const CardInfos = [
    {
        id: "1",
        title: "My Signups",
        img: {},
        numbers: "150",
        footer: ""
    },
    {
        id: "2",
        title: "Coins Earned",
        img: "/vectors/coin.png",
        numbers: "18",
        footer: ""
    },
    {
        id: "3",
        title: "My Money",
        img: "/vectors/money.png",
        numbers: "120,000",
        footer: ""
    },

]

function MainBoard() {
    return (
        <Box className='mainBoard'>
            <AvatarCard />
            {CardInfos.map(CardInfo => (
                <CardComp 
                    key = {CardInfo.id}
                    cardTitle = {CardInfo.title}
                    icon = {CardInfo.img}
                    number = {CardInfo.numbers}
                    cardFooter = {CardInfo.footer}
                />
            ))}
        </Box>
    )
}

export default MainBoard;
